import Navbar from "../component/navbar/navbar";

const Main = () => {
    return (
        <>
            <Navbar />
            <div className="container-content">
                <div className="header-content-main">
                    <div className="header-content-main-left">
                        <h2>Paw</h2>
                    </div>
                    <div className="header-content-main-right"></div>
                </div>
            </div>
        </>
    );
}
export default Main;
